@Injectable({
  providedIn: 'root'
})

export class DatiServizioService {

 constructor(public http:HttpClient, public router:Route) { }

  getDati(): void {
      this.http.get('../../assets/draghi.json').subscribe(dato =>{

        console.log(dato);
      });
  }

  navigable(){
    this.router.navigable(['/draghi']);
